import React, { useState } from 'react';

function FlightBookingForm() {
    const [flightType, setFlightType] = useState("Khứ hồi");
    const [fromLocation, setFromLocation] = useState("");
    const [toLocation, setToLocation] = useState("");
    const [departDate, setDepartDate] = useState("");
    const [returnDate, setReturnDate] = useState("");
    const [passengerClass, setPassengerClass] = useState("1 Hành khách Phổ thông");
    const [discountCode, setDiscountCode] = useState("");

    const handleFlightTypeChange = (event) => {
        setFlightType(event.target.value);
    };

    const handleSwapLocations = () => {
        setFromLocation(toLocation);
        setToLocation(fromLocation);
    };

    const handleFormSubmit = () => {
        // Collect form data
        const formData = {
            flightType,
            fromLocation,
            toLocation,
            departDate,
            returnDate,
            passengerClass,
            discountCode
        };

        console.log("Form Submitted", formData);
        // Further processing here, e.g., validation, API call
    };

    return (
        <div className="flight-booking-container">
            <div className="tabs">
                <button className="tab">✈️ Đặt chuyến bay</button>
                <button className="tab">➕ Stopover / Gói dịch vụ</button>
                <button className="tab">📅 Quản lý / Làm thủ tục</button>
                <button className="tab">📍 Trạng thái chuyến bay</button>
            </div>

            <div className="booking-options">
                <label>
                    <input type="radio" name="flightType" value="Khứ hồi" checked={flightType === "Khứ hồi"} onChange={handleFlightTypeChange} /> Khứ hồi
                </label>
                <label>
                    <input type="radio" name="flightType" value="Một chiều" checked={flightType === "Một chiều"} onChange={handleFlightTypeChange} /> Một chiều
                </label>
                <label>
                    <input type="radio" name="flightType" value="Nhiều thành phố" checked={flightType === "Nhiều thành phố"} onChange={handleFlightTypeChange} /> Nhiều thành phố
                </label>
            </div>

            <div className="booking-form">
                <div className="location-fields">
                    <input type="text" placeholder="Từ" value={fromLocation} onChange={(e) => setFromLocation(e.target.value)} />
                    <span className="swap-icon" onClick={handleSwapLocations}>⇆</span>
                    <input type="text" placeholder="Đến" value={toLocation} onChange={(e) => setToLocation(e.target.value)} />
                </div>

                <div className="date-passenger-container">
                    <div className="date-fields">
                        <div className="date-field">
                            <label>Ngày đi</label>
                            <input type="date" value={departDate} onChange={(e) => setDepartDate(e.target.value)} />
                        </div>
                        <div className="date-field">
                            <label>Ngày về</label>
                            <input type="date" value={returnDate} onChange={(e) => setReturnDate(e.target.value)} disabled={flightType === "Một chiều"} />
                        </div>
                    </div>

                    <div className="passenger-class-field">
                        <label>Hành khách / Hạng ghế</label>
                        <select value={passengerClass} onChange={(e) => setPassengerClass(e.target.value)}>
                            <option>1 Hành khách Phổ thông</option>
                            <option>2 Hành khách Phổ thông</option>
                            <option>1 Hành khách Hạng thương gia</option>
                        </select>
                    </div>

                    <div className="discount-search-container">
                        <div className="discount-code">
                            <a href="#add-code">+ Thêm mã ưu đãi</a>
                        </div>
                        <button className="search-button" onClick={handleFormSubmit}>Tìm chuyến bay</button>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default FlightBookingForm;
